                    <div onClick={() => handleItemClick(event_thread)} className='cursor-pointer'>
                    <EventThread description ={event_thread.description} location={event_thread.location} name={event_thread.name}/>
                    </div>

                ))}
            </div>
            <div className='flex display-left '>
            </div>
        </div>
    </div>
    )
 )
}
